import React from 'react';
import '../css/Button.css'

class FileUploadButton extends React.Component{
    render(){
      return(
          <div className="button-div">
            <container>
                <h1 className="uploadbutton">+</h1>
            </container>
          </div>
      )
    }
}

export default FileUploadButton
